import React from 'react';
import './nav.css';
import { NavLink } from 'react-router-dom';

const styles = {
    background: {
        background: 'rgb(78, 115, 140)',
    },
    links: {
        color: 'white'
    }
};

export default function Nav() {
    return (
        <nav class="navbar navbar-expand" style={styles.background}>
            <div>

            </div>
            
        </nav>
    )
}
